import React, { useState } from "react";
import DataTableScene from "../scene/DataTableScene";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import Divider from "@material-ui/core/Divider";
import Avatar from "@material-ui/core/Avatar";
import { mockData } from "../data/MockData";
import MetricRow from "../components/main-page-metrics/MetricRow";

const Dashboard = () => {
  const [dateFilter, setDateFilter] = useState("All Orders");
  const handleDateFilter = (newFilter) => {
    setDateFilter(newFilter);
  };
  return (
    <Container maxWidth="xl">
      <Box padding="32px 16px" style={{ display: "flex" }}>
        <div style={{ margin: "4px 16px 4px 0px" }}>
          <Avatar />
        </div>
        <div>
          <Typography variant="h5" style={{ textAlign: "left" }}>
            <span style={{ fontWeight: "bold" }}>Welcome Back, </span> Miranda!
          </Typography>
          <Typography
            variant="body2"
            style={{ textAlign: "left" }}
            color="text.primary"
          >
            Premium user
          </Typography>
        </div>
      </Box>{" "}
      <Divider />
      <Box padding="24px 16px">
        <MetricRow data={mockData} dateFilter={dateFilter} />
      </Box>
      <Divider />
      <DataTableScene
        mockData={mockData}
        handleDateFilter={handleDateFilter}
        dateFilter={dateFilter}
      />
    </Container>
  );
};

export default Dashboard;
